import React from 'react';

const Create = () => {
  return (
    <div className='Create'>
      <form>
        <label>Enter Name</label>
        <br />
        <input />
        <br />
        <label>Enter Bio</label>
        <br />
        <textarea></textarea>
      </form>
    </div>
  );
};

export default Create;
